[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Octonions","category":"page"},{"location":"#Octonions","page":"Home","title":"Octonions","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Octonions.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Octonions]","category":"page"},{"location":"#Octonions.extend_analytic-Tuple{Any, Octonion}","page":"Home","title":"Octonions.extend_analytic","text":"extend_analytic(f, o::Octonion)\n\nEvaluate the extension of the complex analytic function f to the octonions at o.\n\nGiven o = s + a u, where s is the real part, u is a pure unit octonion, and a ge 0 is the magnitude of the imaginary part of o,\n\nf(o) = Re(f(z)) + Im(f(z)) u\n\nis the extension of f to the octonions, where z = s + a i is a complex analog to o.\n\nSee [DentoniSce1973] and [ColomboSabadini2020] for details.\n\n[DentoniSce1973]: Dentoni, P. and Sce M. \"Funzioni regolari nell'algebra di Cayley.\"                Rendiconti del Seminario matematico della Universit√† di Padova 50 (1973): 251-267.                Translation: [ColomboSabadini2020]\n\n[ColomboSabadini2020]: Colombo, F., Sabadini, I., Struppa, D.C. (2020).                     Regular Functions in the Cayley Algebra.                     In: Michele Sce's Works in Hypercomplex Analysis.                     doi: 10.1007/978-3-030-50216-4_6\n\n\n\n\n\n","category":"method"}]
